import './Dollars.css';
import Media from 'react-media';

// Dollars component 
export default function REturnFRanC() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-dollars-dash'>
  <div className='wrp-card-bal'>
   <div className='wrp-sub-card-bal'>
    <h5>Compte Franc</h5>
    <p>Cliquez sur une collection pour,  sous-collection</p>
    <p className='wrp-count'>¢1243783</p>
   </div>
  </div>
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-dollars-dash-sm'>
  <div className='wrp-card-bal-sm'>
   <div className='wrp-sub-card-bal-sm'>
    <h5>Compte Franc</h5>
    <p>Cliquez sur une collection pour,  sous-collection</p>
    <p className='wrp-count'>¢1243783</p>
   </div>
  </div>
 </div>
);
